<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Gráficos: Flourish + Datawrapper + SVG</title>
  <style>
    :root { --panel-max-h: 42vh; }
    * { box-sizing: border-box; }
    body {
      margin: 0; font-family: system-ui, -apple-system, Segoe UI, Roboto, Arial, sans-serif;
      background: #f7f7f7;
    }
    .wrap { max-width: 1200px; margin: 0 auto; padding: 16px; }
    .grid {
      display: grid; gap: 16px;
      grid-template-columns: 1fr;
    }
    @media (min-width: 900px) {
      .grid { grid-template-columns: 1fr 1fr; }
    }
    .card {
      background: #fff; border-radius: 12px; padding: 12px;
      box-shadow: 0 2px 10px rgba(0,0,0,.06);
      display: flex; flex-direction: column; gap: 8px;
    }
    .card h2 { margin: 0 0 4px; font-size: 1rem; font-weight: 600; color: #222; }

    .flourish-embed { width: 100%; border-radius: 8px; overflow: hidden; }
    .flourish-embed iframe { width: 100% !important; border: 0; }

    .dw-wrap { width: 100%; border-radius: 8px; overflow: hidden; }
    .dw-wrap iframe {
      width: 100% !important;
      border: 0;
      aspect-ratio: 16 / 9;
      height: auto;
      min-height: 280px;
    }

    .svg-wrap {
      width: 100%;
      max-height: var(--panel-max-h);
      overflow: auto;
      border-radius: 8px;
      background: #fff;
    }
    .svg-wrap svg {
      display: block;
      width: 100%;
      height: auto;
    }
  </style>
</head>
<body>
  <div class="wrap">
    <div class="grid">
      <!-- Panel 1: Flourish -->
      <section class="card">
        <h2>Flourish</h2>
        <div class="flourish-embed flourish-chart" data-src="visualisation/25244061"></div>
      </section>

      <!-- Panel 2: Datawrapper -->
      <section class="card">
        <h2>Datawrapper</h2>
        <div class="dw-wrap">
          <iframe
            title="¿Cuánta música escucho?"
            aria-label="Líneas"
            id="datawrapper-chart-e2CYw"
            src="https://datawrapper.dwcdn.net/e2CYw/1/"
            scrolling="no"
            data-external="1">
          </iframe>
        </div>
      </section>

      <!-- Panel 3: Flourish – Bar Chart Race -->
      <section class="card">
        <h2>Flourish – Bar Chart Race</h2>
        <div class="flourish-embed flourish-bar-chart-race" data-src="visualisation/25243763">
          <noscript>
            <img src="https://public.flourish.studio/visualisation/25243763/thumbnail" width="100%" alt="bar-chart-race visualization" />
          </noscript>
        </div>
      </section>
